import React from "react";
import "./card.css";
import card from "../../image/card.jpg";
function Card() {
  return (
    <div className="page">
      <div className="card">
        <div className="card-body">
          <section className="debit-card">
            <img src={card} />
            <div className="card-type">Debit Card</div>
            <div className="card-name">Freedom card</div>
            <div className="card-number">1234 5678 9012 3456</div>
            <span className="card-expiry">12/25</span>
          </section>
          <section className="credit-card">
            <div className="card-type">Credit Card</div>
            <div className="card-number">1234 5678 9012 3456</div>
            <span className="card-expiry">12/25</span>
          </section>
        </div>
      </div>
    </div>
  );
}

export default Card;
